Behind the content, the imagery, the planning, the business, and the brand… there’s a team!! I refer to them often bc literally nothing that you see here would happen without them, but I’ve realized they haven’t been properly introduced. Meet the SoP Team:
@shadesofpinck: Founder + Lead Creator! The face you alwayssss see, but behind the scenes I work with @jujumelv x @shinetalentgroup to lock in deals, sign contracts and make sure that we never sway too far away from the brand’s original ethos.
@thejoshelvis: Creative Director! The visionary behind the brand. He manages each project and oversees the team, ensuring everyone is on the same page. When he’s not editing reels, he’s crafting the look + feel of nearly every image you see.
@small.marge: Asst Creator + Digital Strategist! My right hand for all campaigns. She works closely with brands + my management team to ensure every single detail is locked in and aligns with our overall goal. From shot lists to photoshoots, from blog posts to hashtags, she’s making sure everything goes live the exact way we’ve intend our community to see it.
@meredithkbrown: Product Manager! The queen of the wardrobe. She manages any and everything that you can shop. Between unboxing, styling, sourcing, creating lookbooks, prepping for photoshoots and posting products to affiliate sites + the blog, chances are there’s nothing you’ve seen me with that she hasn’t had her hands on.
@journee.southall: Product coordinator! The girl on the move. Not only does she ensure products end up where they need to go (think: post office, my home closet, somewhere else in the city), she sources items from local shops and updates us on our IG + blog insights every month.
@jalynowens129: Political Strategist! Our eyes and ears on what’s happening in the world! Using her knowledge + love for political science, she helps our team turn political events into content and manages the @reptoddrutherford account.
Crush @crushrushsc: Photographer! The artist behind the images. Whether he physically takes the photo or not, most content receives his eye for edits.
Head to my story to learn a little more about each team member!! 🎀 #shadesofpinck #apincksc

